CREATE TABLE processed_emoji_data (
    `id` INT AUTO_INCREMENT PRIMARY KEY,
    `Emoji` VARCHAR(10),
    `Unicode codepoint_x` VARCHAR(20),
    `Sentiment_Occurrences` INT,
    `Position` FLOAT,
    `Negative` INT,
    `Neutral` INT,
    `Positive` INT,
    `Unicode name` VARCHAR(100),
    `Unicode block` VARCHAR(100),
    `Unicode codepoint_y` VARCHAR(20),
    `Tracker_Occurrences` BIGINT,
    `RiskScore` FLOAT,
    `RiskLevel` VARCHAR(10)
);

